class CartItem {
    constructor(quantity, prodPrice, prodTitle, sum) {
        this.quantity = quantity;
        this.prodPrice = prodPrice;
        this.prodTitle = prodTitle;
        this.sum = sum;
    }
} 

export default CartItem;
